PROBLEM: 'Randy drove the first third of his trip on a gravel road, the next '$20$" miles on pavement, and the remaining one-fifth on a dirt road. In miles how long was Randy's trip?\n"
=======
CHOICES:
[A]: 30
[B]: \frac{400}{11}
[C]: \frac{75}{2}
[D]: 40
[E]: \frac{300}{7}

PROBLEM: 'Susie pays for '$4$' muffins and '$3$' bananas. Calvin spends twice as much paying for '$2$' muffins and '$16$' bananas. A muffin is how many times as expensive as a banana?\n'
=======
CHOICES:
[A]: \frac{3}{2}
[B]: \frac{5}{3}
[C]: \frac{7}{4}
[D]: 2
[E]: \frac{13}{4}

PROBLEM: 'A truck travels '$\dfrac{b}{6}$' feet every '$t$' seconds. There are '$3$' feet in a yard. How many yards does the truck travel in '$3$' minutes?\n'
=======
CHOICES:
[A]: \frac{b}{1080t}
[B]: \frac{30t}{b}
[C]: \frac{30b}{t}
[D]: \frac{10t}{b}
[E]: \frac{10b}{t}

PROBLEM: 'Four fair six-sided dice are rolled. What is the probability that at least three of the four dice show the same value?\n'
=======
CHOICES:
[A]: \frac{1}{36}
[B]: \frac{7}{72}
[C]: \frac{1}{9}
[D]: \frac{5}{36}
[E]: \frac{1}{6}

PROBLEM: 'Two concentric circles have radii '$1$' and '$2$'. Two points on the outer circle are chosen independently and uniformly at random. What is the probability that the chord joining the two points intersects the inner circle?\n'
=======
CHOICES:
[A]: \frac{1}{6}
[B]: \frac{1}{4}
[C]: \frac{2-\sqrt{2}}{2}
[D]: \frac{1}{3}
[E]: \frac{1}{2}

PROBLEM: 'Trapezoid '$ABCD$' has parallel sides '$\overline{AB}$' of length '$33$' and '$\overline {CD}$' of length '$21$'. The other two sides are of lengths '$10$' and '$14$'. The angles '$A$' and '$B$' are acute. What is the length of the shorter diagonal of '$ABCD$'?\n'
=======
CHOICES:
[A]: 10\sqrt{6}
[B]: 25
[C]: 8\sqrt{10}
[D]: 18\sqrt{2}
[E]: 26
